CREATE OR REPLACE FUNCTION add_months(start DATE, months INT) RETURNS DATE AS
$$
  SELECT (start + (months || ' months')::INTERVAL)::DATE
$$
LANGUAGE sql IMMUTABLE;



UPDATE grades g
SET (created_date,modified_date)=(SELECT ADD_MONTHS(start_date_time,4),ADD_MONTHS(start_date_time,5)
                                  FROM sections
                                  WHERE section_id=g.section_id);

